  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for fiscal
  year 1939 covers Refuge activities on Ninepipe, Pablo, Pishkun, Willow Creek and
  Benton Lake National Wildlife Refuges. Topics include: uses made of the Refuges
  by animals, use of the refuges by man, plantings, predatory animal control, Refuge
  improvement, scientific progress, law enforcement, water conditions, suggestions
  of policy and items of interest. A mammal and bird species sited list is included.\",\n\t\"license_title\":
